long long test(int i){
  long long sum = N*(N + 1)/2;
  vector <bool> q(N, false);
  for(int j = 0;j < N - 1;j++){
    int ind = abs(Numbers[j] - i) - 1;
    if(ind < 0 || ind >= N || q[ind]){
      return 0;
    }
    q[ind] = true;
    sum -= (ind + 1);
  }
  return sum;
}

